import React, { useContext, useState } from 'react';
import { LanguageContext } from '../App';
import { translations } from '../utils/translations';

// Contact page with form and school information
function Contact() {
  const { language } = useContext(LanguageContext);
  const t = translations.contact;

  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    subject: '',
    message: ''
  });

  const [isSubmitted, setIsSubmitted] = useState(false);
  const [errors, setErrors] = useState({});

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
    // Clear error for this field
    if (errors[name]) {
      setErrors({ ...errors, [name]: '' });
    }
  };

  const validateForm = () => {
    const newErrors = {};
    if (!formData.name.trim()) newErrors.name = t.errorName[language];
    if (!formData.email.trim()) newErrors.email = t.errorEmail[language];
    if (!formData.message.trim()) newErrors.message = t.errorMessage[language];
    return newErrors;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const newErrors = validateForm();

    if (Object.keys(newErrors).length === 0) {
      // Form is valid - simulate submission
      setIsSubmitted(true);
      setFormData({ name: '', email: '', phone: '', subject: '', message: '' });

      // Hide success message after 5 seconds
      setTimeout(() => {
        setIsSubmitted(false);
      }, 5000);
    } else {
      setErrors(newErrors);
    }
  };

  return (
    <div className="page-container contact-page">
      {/* Page Header */}
      <div className="page-header">
        <h1 className="page-title">{t.title[language]}</h1>
        <p className="page-subtitle">{t.subtitle[language]}</p>
      </div>

      <div className="container">
        <div className="contact-layout">
          {/* Contact Form */}
          <section className="form-section">
            <h2>{t.formTitle[language]}</h2>

            {isSubmitted && (
              <div className="success-message">
                {t.successMsg[language]}
              </div>
            )}

            <form className="contact-form" onSubmit={handleSubmit}>
              <div className="form-group">
                <label htmlFor="name" className="form-label">
                  {t.nameLabel[language]} <span className="required">*</span>
                </label>
                <input
                  type="text"
                  id="name"
                  name="name"
                  className={`form-input ${errors.name ? 'error' : ''}`}
                  value={formData.name}
                  onChange={handleChange}
                  placeholder={t.namePlaceholder[language]}
                />
                {errors.name && <span className="error-text">{errors.name}</span>}
              </div>

              <div className="form-group">
                <label htmlFor="email" className="form-label">
                  {t.emailLabel[language]} <span className="required">*</span>
                </label>
                <input
                  type="email"
                  id="email"
                  name="email"
                  className={`form-input ${errors.email ? 'error' : ''}`}
                  value={formData.email}
                  onChange={handleChange}
                  placeholder={t.emailPlaceholder[language]}
                />
                {errors.email && <span className="error-text">{errors.email}</span>}
              </div>

              <div className="form-group">
                <label htmlFor="phone" className="form-label">
                  {t.phoneLabel[language]}
                </label>
                <input
                  type="tel"
                  id="phone"
                  name="phone"
                  className="form-input"
                  value={formData.phone}
                  onChange={handleChange}
                  placeholder={t.phonePlaceholder[language]}
                />
              </div>

              <div className="form-group">
                <label htmlFor="subject" className="form-label">
                  {t.subjectLabel[language]}
                </label>
                <input
                  type="text"
                  id="subject"
                  name="subject"
                  className="form-input"
                  value={formData.subject}
                  onChange={handleChange}
                  placeholder={t.subjectPlaceholder[language]}
                />
              </div>

              <div className="form-group">
                <label htmlFor="message" className="form-label">
                  {t.messageLabel[language]} <span className="required">*</span>
                </label>
                <textarea
                  id="message"
                  name="message"
                  className={`form-input ${errors.message ? 'error' : ''}`}
                  value={formData.message}
                  onChange={handleChange}
                  placeholder={t.messagePlaceholder[language]}
                  rows="5"
                ></textarea>
                {errors.message && <span className="error-text">{errors.message}</span>}
              </div>

              <button type="submit" className="btn btn-primary btn-submit">
                {t.submitBtn[language]}
              </button>
            </form>
          </section>

          {/* Contact Information */}
          <section className="contact-info-section">
            <h2>{t.infoTitle[language]}</h2>

            <div className="contact-details">
              <div className="contact-item">
                <span className="contact-icon">üìç</span>
                <div>
                  <h4>{t.addressLabel[language]}</h4>
                  <p>{t.address[language]}</p>
                </div>
              </div>

              <div className="contact-item">
                <span className="contact-icon">üìû</span>
                <div>
                  <h4>{t.phoneLabel[language]}</h4>
                  <p>+977-1-4567890</p>
                  <p>+977-9841234567</p>
                </div>
              </div>

              <div className="contact-item">
                <span className="contact-icon">‚úâÔ∏è</span>
                <div>
                  <h4>{t.emailLabel[language]}</h4>
                  <p>info@himalayaapex.edu.np</p>
                  <p>admissions@himalayaapex.edu.np</p>
                </div>
              </div>

              <div className="contact-item">
                <span className="contact-icon">üïê</span>
                <div>
                  <h4>{t.hoursLabel[language]}</h4>
                  <p>{t.hours[language]}</p>
                </div>
              </div>
            </div>

            {/* Map Placeholder */}
            <div className="map-placeholder">
              <span className="map-pin">üìç</span>
              <p className="map-text">{t.mapText[language]}</p>
            </div>
          </section>
        </div>
      </div>
    </div>
  );
}

export default Contact;
